import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class CompfoieService {

  private apiUrl = 'https://localhost:7129/api/ComplicationFoies';

  constructor(private http: HttpClient) { }
  addcompcoeur(ComplicationCoeur: ComplicationCoeur): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationCoeur);

    return this.http.post<any>(`${this.apiUrl}/addcompcoeur`, ComplicationCoeur, { observe: 'response' });
  }}
